import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-8c0d893a319db",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/jimmy/Project/rssdocs/docs/README.md").then(comp => {
        Vue.component("v-8c0d893a319db", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-038454b8a26c1",
    path: "/content/about/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/jimmy/Project/rssdocs/docs/content/about/README.md").then(comp => {
        Vue.component("v-038454b8a26c1", comp.default)
        next()
      })
    }
  },
  {
    path: "/content/about/index.html",
    redirect: "/content/about/"
  },
  {
    name: "v-65d9e2693b8a6",
    path: "/content/api/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/jimmy/Project/rssdocs/docs/content/api/README.md").then(comp => {
        Vue.component("v-65d9e2693b8a6", comp.default)
        next()
      })
    }
  },
  {
    path: "/content/api/index.html",
    redirect: "/content/api/"
  },
  {
    name: "v-576b89ebdc4eb",
    path: "/content/install/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/jimmy/Project/rssdocs/docs/content/install/README.md").then(comp => {
        Vue.component("v-576b89ebdc4eb", comp.default)
        next()
      })
    }
  },
  {
    path: "/content/install/index.html",
    redirect: "/content/install/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
